import React, { Component } from "react"
import "./bucketList"

function bucketList(props) {
    const {bucket} = props;

    return (
        <div className="divider">
            {bucket && bucket.map((bucketItems,i) =>
                <div className="card flex col">
                    <div className="flex spaceBetween"> {bucketItems["name"]} </div>
                    <div className="marginTop"> {bucketItems["country"]} </div>
                </div>

            )}
        </div>
    )
}
export default bucketList
